function formatPriceTooltips() {
    // –ñ–¥–µ–º –∑–∞–≥—Ä—É–∑–∫–∏ –∫–∞—Ä—Ç—ã
    setTimeout(function() {
        // –ù–∞—Ö–æ–¥–∏–º –≤—Å–µ —ç–ª–µ–º–µ–Ω—Ç—ã —Å —Ü–µ–Ω–∞–º–∏ –≤ —Ç—É–ª—Ç–∏–ø–∞—Ö
        var tooltips = document.querySelectorAll('.leaflet-tooltip');
        tooltips.forEach(function(tooltip) {
            var text = tooltip.textContent;
            // –ò—â–µ–º —á–∏—Å–ª–∞ –≤ —Ç–µ–∫—Å—Ç–µ (—Ñ–æ—Ä–º–∞—Ç: "–°—Ä–µ–¥–Ω—è—è —Ü–µ–Ω–∞ –∑–∞ –º¬≤: 123456.78")
            if (text.includes('–°—Ä–µ–¥–Ω—è—è —Ü–µ–Ω–∞ –∑–∞ –º¬≤:')) {
                var priceMatch = text.match(/(\d+\.?\d*)/);
                if (priceMatch) {
                    var price = parseFloat(priceMatch[0]);
                    // –û–∫—Ä—É–≥–ª—è–µ–º –¥–æ —Ü–µ–ª–æ–≥–æ –∏ —Ñ–æ—Ä–º–∞—Ç–∏—Ä—É–µ–º —Å –ø—Ä–æ–±–µ–ª–∞–º–∏
                    var formattedPrice = Math.round(price).toString().replace(/\B(?=(\d{3})+(?!\d))/g, " ");

                }
            }
        });
    }, 1000);
}

// –ó–∞–ø—É—Å–∫–∞–µ–º –ø—Ä–∏ –∑–∞–≥—Ä—É–∑–∫–µ –∏ –ø—Ä–∏ –∏–∑–º–µ–Ω–µ–Ω–∏–∏
document.addEventListener('DOMContentLoaded', formatPriceTooltips);
document.addEventListener('leaflet-map-loaded', formatPriceTooltips);

// –¢–∞–∫–∂–µ –ø–µ—Ä–µ—Ö–≤–∞—Ç—ã–≤–∞–µ–º —Å–æ–∑–¥–∞–Ω–∏–µ –Ω–æ–≤—ã—Ö —Ç—É–ª—Ç–∏–ø–æ–≤
var originalCreateTooltip = L.Tooltip.prototype._updateContent;

};
